import React, {useState, useEffect} from 'react';
import {Route, Switch } from 'react-router-dom'
import Login from './components/Login'
import PrivateRoute from './components/PrivateRoute'
import axiosWithAuth from './components/axiosWithAuth'
import './App.css';
import Signup from './components/Signup';
import DinerDash from './components/Diner/DinerDash'
// import {DinersListProvider} from './Contexts/DinerContext'
// import {DinerProvider} from './Contexts/DinerContext'
// import {DinerTrucksProvider} from './Contexts/DinerContext'
import {DinerContext} from './Contexts/DinerContext'


function App() {
      const [dinersList, setDinersList] = useState([]);
    console.log(dinersList)

    useEffect(()=>{

    axiosWithAuth().get('/api/diners')
    .then(res =>{
        console.log(res.data.users)
        setDinersList(res.data.users)
    })
    .catch(err =>{
        console.log('No Data coming in', err)
    })
}, [])

  return (

    <DinerContext.Provider>
    <div className="App">
    <Switch>
    <Route path='/' exact component ={Login}/>
    <Route path='/Signup' component={Signup}/>
    <PrivateRoute path='/Diner/DashBoard' component={DinerDash}/>
    </Switch>
    </div>
    </DinerContext.Provider>

  );
}

export default App;
